import React from "react";

import { UncontrolledCollapse, Button, CardBody, Card, Container } from "reactstrap";


class Faq extends React.Component {
  render() {
    return (
      <>
        <Container>
        <Button color="primary" href="#collapseExample" id="linkToggler" style={{flex: 1}}>
          Link
        </Button>
        <br></br>
        <Button color="primary" id="buttonToggler">
          Button
        </Button>
        <UncontrolledCollapse toggler="#linkToggler,#buttonToggler" style={{flex: 1}}>
          <Card>
            <CardBody>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Nesciunt
              magni, voluptas debitis similique porro a molestias consequuntur
              earum odio officiis natus, amet hic, iste sed dignissimos esse
              fuga! Minus, alias.
            </CardBody>
          </Card>
        </UncontrolledCollapse>
        </Container>
      </>
    );
  }
}

export default Faq;
